import { createTheme } from "@mui/material/styles";

let theme = createTheme({
  palette: {
    type: "light",
    primary: {
      main: "#40a339",
    },
    secondary: {
      main: "#01312b",
    },
    background: {
      default: "#e8e8e8",
    },
    success: {
      main: "#2dfdc6",
    },
    error: {
      main: "#f44336",
    },
    warning: {
      main: "#ff9800",
    },
    info: {
      main: "#2196f3",
    },
    divider: "rgba(0,0,0,0.12)",
    text: {
      primary: "rgba(0,0,0,0.87)",
    },
  },
  typography: {
    fontFamily: "Montserrat",
    h1: {
      fontFamily: "Libre Baskerville",
    },
  },
});

export { theme };
